import React from 'react';
import { QueryMachine } from './stateMachines/queryMachine';
import UserInputField from './components/userInputField';
import './output.css';
import LargeQuery from './components/largeQuery';

function App() {
  return (
    <QueryMachine>
      <div className="w-full">
        <LargeQuery queryString={"What are we building?"}/>
        <UserInputField />
      </div>
    </QueryMachine>
  );
}

export default App;
